import React from 'react';
import { useDispatch } from 'react-redux';
import { setPersona, setShowNameModal } from '../store/uiSlice';

const PersonaSelector = () => {
  const dispatch = useDispatch();

  const handlePersonaSelect = (persona) => {
    dispatch(setPersona(persona));
    if (persona === 'student') {
      dispatch(setShowNameModal(true));
    }
  };

  return (
    <div className="container">
      <div className="card fade-in" style={{ textAlign: 'center', maxWidth: '600px', margin: '100px auto' }}>
        <h1 style={{ 
          fontSize: '48px', 
          marginBottom: '20px',
          background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
          WebkitBackgroundClip: 'text',
          WebkitTextFillColor: 'transparent',
          backgroundClip: 'text'
        }}>
          Live Polling System
        </h1>
        <p style={{ fontSize: '18px', color: '#666', marginBottom: '40px' }}>
          Choose your role to get started
        </p>
        
        <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px' }}>
          <div 
            className="card" 
            style={{ 
              cursor: 'pointer', 
              textAlign: 'center',
              border: '2px solid transparent',
              transition: 'all 0.3s ease'
            }}
            onClick={() => handlePersonaSelect('teacher')}
            onMouseEnter={(e) => {
              e.currentTarget.style.borderColor = '#667eea';
              e.currentTarget.style.transform = 'translateY(-5px)';
            }}
            onMouseLeave={(e) => {
              e.currentTarget.style.borderColor = 'transparent';
              e.currentTarget.style.transform = 'translateY(0)';
            }}
          >
            <div style={{ fontSize: '64px', marginBottom: '20px' }}>üë®‚Äçüè´</div>
            <h2 style={{ marginBottom: '10px', color: '#333' }}>Teacher</h2>
            <p style={{ color: '#666', lineHeight: '1.5' }}>
              Create polls, view live results, and manage your classroom
            </p>
          </div>
          
          <div 
            className="card" 
            style={{ 
              cursor: 'pointer', 
              textAlign: 'center',
              border: '2px solid transparent',
              transition: 'all 0.3s ease'
            }}
            onClick={() => handlePersonaSelect('student')}
            onMouseEnter={(e) => {
              e.currentTarget.style.borderColor = '#667eea';
              e.currentTarget.style.transform = 'translateY(-5px)';
            }}
            onMouseLeave={(e) => {
              e.currentTarget.style.borderColor = 'transparent';
              e.currentTarget.style.transform = 'translateY(0)';
            }}
          >
            <div style={{ fontSize: '64px', marginBottom: '20px' }}>üë®‚Äçüéì</div>
            <h2 style={{ marginBottom: '10px', color: '#333' }}>Student</h2>
            <p style={{ color: '#666', lineHeight: '1.5' }}>
              Answer polls and view real-time results
            </p>
          </div>
        </div>
        
        <div style={{ marginTop: '40px', padding: '20px', background: '#f8f9fa', borderRadius: '12px' }}>
          <h3 style={{ marginBottom: '10px', color: '#333' }}>Features:</h3>
          <ul style={{ textAlign: 'left', color: '#666', lineHeight: '1.6' }}>
            <li>‚ú® Real-time polling with live results</li>
            <li>‚è±Ô∏è Configurable time limits for polls</li>
            <li>üí¨ Built-in chat system</li>
            <li>üìä Interactive result visualization</li>
            <li>üë• Student management</li>
            <li>üì± Responsive design for all devices</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default PersonaSelector;
